import React from "react";
import '../css/registration.css'


function Registration() {
    return (
        <div className="background_registration">
            <h1>Agora nos estaremos juntos</h1>
            <form method="POST">
                <div className="form-group">
                    <label for="exampleFormControlInput1">Nome</label>
                    <input type="text" class="form-control" id="inputName" placeholder="Seu nome" />
                    <label for="exampleFormControlInput1">Email</label>
                    <input type="email" class="form-control" id="inputEmail" placeholder="name@example.com" />
                    <label for="exampleFormControlInput1">Senha</label>
                    <input type="password" class="form-control" id="exampleFormControlInput1" placeholder="thee89384" />
                    <p>Ainda não é cadastrado? Clique aqui</p>
                    <p>Esqueci minha senha</p>
                    <button type="button" class="btn btn-primary">Entrar</button>
                </div>

            </form>
        </div>
    );
}

export default Registration;
